    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["Rettighetshaver", "Rettighetsnavn", "Rettighetstype", "Organisasjonsnummer", "Status", "Mineral", "Kommunenavn", "AvgTh_ppm_str", "MaxTh_ppm_str"];
    let aliases = ["Owner", "Name", "Type", "Organisation number", "Status", "Minerals", "Municipality", "Average Th ppm", "Max Th ppm"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
